  01> HILSON, Richard Patrick m on 18.04.1998 to MIDDELBERG, Karen Elizabeth
  Nelson
  b 15.03.1967
  b 04.11.1966
  Richard b. at Waipukurau. Karen, d/o Albert and Kay Middelberg. Address: C/- Vet Services (HB)
  Ltd, PO Box 503, Waipukurau.
  Richard was educated at Rathkeale College and Massey University (BVSc). He worked in North
  Canterbury for a year and is now a partner in a veterinary practice in Waipukurau, with a
  professional interest in farm animals, especially sheep, deer and cattle.
  Karen is also a veterinarian, working mainly with small animals.
  They both enjoy the great outdoors, tramping, fishing and travelling.
  01> HILSON, Rebecca Anne Middelberg
  b 02.01.1998
  Rebecca b. at Waipukurau.
  02> HILSON, Jane Jollie m on 14.11.1992 to TUCKER, Timothy Peter
  b 14.03.1969
  b 31.05.1968
  Jane b. at Palmerston North and m. at Woodford House Chapel, Havelock North. Timothy, s/o Peter
  Tucker and Kathleen Sturrock. Address: 33 Whitby Road, Nelson.
  Jane was educated at Woodford House and Massey University, graduating BRP with 1st Class Honours in
  1990. She worked in private practice in Christchurch for three years and is now a planning and
  resource management consultant with Staig and Smith Ltd, Nelson.
  Tim is a Dean and Head of History at Nelson College. He is a keen competitive mountain biker.
  03> HILSON, Alastair
  b 08.11.1971
  Alastair attended Rathkeale College and gained a Certificate in Landscaping from Hawkes Bay
  Polytechnic. He then worked in horticulture then for an agricultural contracting firm in England.
  He is now a freelance production assistant in the film industry in Hollywood.
  Alastair walked and cycled on his own across the widest part of Africa, from west to east, a trip
  lasting a year. Whilst in Africa he designed a permaculture centre in Uganda and studied
  permaculture in Zimbabwe.
  02> NELSON, Mary Jane Rosamond m on 18.05.1967 to MOODIE, John Eisdell
  b 22.01.1944
  b 15.05.1942
  Jane b. at Hastings and m, at St Mark's Church, Takapau. John, s/o John (Jack)
  Ernest Moodie (b. 1916, d. 1941, fighter pilot) and Mildred (Mim) Lofthouse
  (b. 02.10.1916 in England, remarried to Hugh Noakes in 1949). Address: 781a
  Bruntwood Road, RD 3, Hamilton,
  Jane was educated at Woodford House and graduated BSc (Hons) from Otago
  University. She did biochemistry research at Otago University and at Ruakura
  Research Station prior to motherhood.
  John was educated at King's College, Auckland then studied Medicine at Otago University. He and Jane
  met through a shared interest in tramping whilst at Otago. They lived in the UK in 1973-76 with Sarah
  and Anna while John studied Anaesthesia at Liverpool and Glasgow. They returned to Hamilton where John
  took up an anaesthetic consultancy and is now also doing analgesic research. He was President of the
  New Zealand Society of Anaesthetists in 1983-84.
  Jane was a founding editor of the local monthly newspaper, and is currently on the Board of Trustees of
  (cont...).
